INSERT INTO `products` (`product_id`, `product_name`, `description`, `short_description`, `price`, `stock`, `category_id`, `weight`, `dimensions`, `material`, `origin`, `warranty_period`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Bàn gỗ tự nhiên', 'Bàn làm việc có ngăn kéo được chế tác từ gỗ me tây tự nhiên nguyên khối, đảm bảo sự bền bỉ và đẹp mắt trong suốt quá trình sử dụng. Chất liệu gỗ me tây mang đến hệ vân gỗ tuyệt đẹp, là điểm nhấn nổi bật và sang trọng cho bàn làm việc. Đặc biệt, gỗ me tây còn có độ bền cao và không mối mọt tự nhiên, giúp sản phẩm luôn giữ được vẻ mới và đẹp suốt thời gian dài.', 'Bàn làm việc gỗ tự nhiên có 1 hộc tủ và 4 ngắn kéo nhằm tăng không gian lưu trữ tài liệu, bền đẹp mà còn giá trị.', 10499999.97, 0, 1, 15.01, '40x70x60', 'Gỗ me tây', 'Việt Nam', 12, 'out_of_stock', '2024-12-14 07:54:51', '2025-01-06 14:10:31'),
(2, 'Ghế gỗ thư giãn', 'Ghế gỗ thư giãn là một sản phẩm nội thất lý tưởng cho không gian sống của bạn, mang đến sự thoải mái và phong cách. Được làm từ chất liệu gỗ tự nhiên cao cấp, ghế có độ bền cao và khả năng chịu lực tốt. Thiết kế tinh tế với các đường nét mềm mại, ghế không chỉ là nơi để ngồi mà còn là điểm nhấn nghệ thuật cho không gian.\r\nGhế được thiết kế với độ ngả linh hoạt, giúp người sử dụng dễ dàng điều chỉnh tư thế ngồi theo ý muốn. Bề mặt ghế được hoàn thiện mịn màng, mang lại cảm giác dễ chịu khi tiếp xúc. Ngoài ra, ghế còn có thể kết hợp với các loại đệm êm ái để tăng thêm sự thoải mái.', 'Ghế gỗ thư giãn là sản phẩm nội thất hoàn hảo, được làm từ gỗ tự nhiên bền bỉ, thiết kế tinh tế và linh hoạt.', 1500000.00, 3, 1, 15.00, '100x90x80', 'Gỗ căm xe', 'Việt Nam', 12, 'low_stock', '2024-12-14 07:54:51', '2025-01-06 14:39:23'),
(3, 'Tượng gỗ cá chép', 'Tượng gỗ cá chép là một tác phẩm nghệ thuật tinh xảo, được chế tác từ gỗ tự nhiên cao cấp, mang đến vẻ đẹp sang trọng và ý nghĩa phong thủy sâu sắc. Với thiết kế tỉ mỉ, tượng thể hiện hình ảnh cá chép bơi lội đầy sức sống, tượng trưng cho sự thịnh vượng, may mắn và nỗ lực vượt qua khó khăn. Sản phẩm không chỉ là một món đồ trang trí mà còn là biểu tượng của sự thành công trong cuộc sống.', 'Tượng gỗ cá chép là biểu tượng của may mắn và thịnh vượng, được làm từ gỗ tự nhiên với thiết kế tỉ mỉ. Sản phẩm mang lại vẻ đẹp sang trọng cho không gian sống và có ý nghĩa phong thủy tích cực.', 3000000.00, 4, 1, 4.00, '40x30x20', 'Gỗ tự nhiên', 'Việt Nam', 12, 'low_stock', '2024-12-14 07:54:51', '2025-01-06 14:39:27'),
(152, 'Vòng Trầm Hương', 'Vòng trầm hương được làm từ gỗ trầm tự nhiên, mang hương thơm dịu nhẹ giúp thư giãn và giảm căng thẳng. Sản phẩm có ý nghĩa phong thủy, mang lại may mắn và tài lộc cho người đeo.', 'Vòng trầm hương tự nhiên, hương thơm phong thủy.', 5000000.00, 90, 1, 50.00, '20 (chu vi)', 'Trầm hương', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:13', '2025-01-06 11:47:59'),
(153, 'Tượng Gỗ Thần Tài', 'Tượng gỗ Thần Tài được chạm khắc tỉ mỉ từ gỗ hương chất lượng cao, tượng trưng cho sự phú quý, thịnh vượng và bình an. Sản phẩm phù hợp để trang trí bàn thờ hoặc phòng khách.', 'Tượng Thần Tài bằng gỗ hương, biểu tượng tài lộc.', 15000000.00, 50, 1, 5.00, '30x20x20', 'Gỗ hương', 'Việt Nam', 24, 'in_stock', '2025-01-01 18:04:14', '2025-01-01 18:04:14'),
(154, 'Tượng Gỗ Nhất Mã Phi Thiên', 'Tượng gỗ Nhất Mã Phi Thiên thể hiện sức mạnh, ý chí và sự thăng tiến trong công việc. Được làm từ gỗ cao cấp, sản phẩm có độ bền cao và ý nghĩa phong thủy mạnh mẽ.', 'Tượng ngựa phi thiên bằng gỗ, biểu tượng thành công.', 20000000.00, 27, 1, 7.00, '50x40x30', 'Gỗ hương', 'Việt Nam', 24, 'in_stock', '2025-01-01 18:04:15', '2025-01-02 02:43:14'),
(155, 'Tượng Voi Bằng Gỗ Nu Hương', 'Tượng voi bằng gỗ nu hương được chế tác tinh xảo, biểu tượng của sự thông thái, quyền lực và may mắn. Kích thước lớn, phù hợp trưng bày trong phòng khách hoặc văn phòng.', 'Tượng voi bằng gỗ nu hương, ý nghĩa phong thủy.', 35000000.00, 20, 1, 35.00, '60x50x55', 'Gỗ nu hương', 'Việt Nam', 36, 'in_stock', '2025-01-01 18:04:16', '2025-01-01 18:19:46'),
(156, 'Thuyền Buồm Gỗ', 'Thuyền buồm gỗ được làm thủ công từ gỗ tự nhiên, mang ý nghĩa thuận buồm xuôi gió trong kinh doanh. Sản phẩm có thiết kế tinh tế, phù hợp làm quà tặng hoặc trang trí.', 'Thuyền buồm gỗ, biểu tượng thành công và thuận lợi.', 12000000.00, 39, 1, 3.00, '40x30x20', 'Gỗ hương', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:17', '2025-01-07 06:31:58'),
(157, 'Đồng Hồ Phong Thủy Gỗ Nu', 'Đồng hồ phong thủy kết hợp giữa gỗ nu hương cao cấp và hình tượng Nghê Béo Long Mã, mang đến vẻ đẹp sang trọng và ý nghĩa bảo vệ gia đình.', 'Đồng hồ phong thủy bằng gỗ nu hương, bảo vệ và thịnh vượng.', 18000000.00, 15, 1, 8.00, '60x50x20', 'Gỗ nu hương', 'Việt Nam', 24, 'in_stock', '2025-01-01 18:04:18', '2025-01-01 18:06:02'),
(158, 'Đèn Gỗ', 'Đèn gỗ thiết kế độc đáo, kết hợp giữa vẻ đẹp tự nhiên và ánh sáng ấm áp, phù hợp trang trí trong không gian sống hiện đại.', 'Đèn gỗ trang trí, ánh sáng ấm áp.', 5000000.00, 58, 1, 2.00, '30x15x15', 'Gỗ mít', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:19', '2025-01-07 06:37:46'),
(159, 'Bình Hoa Gỗ Mít', 'Bình hoa làm từ gỗ mít tự nhiên, được chế tác thủ công với đường nét mượt mà, mang phong cách truyền thống và tinh tế.', 'Bình hoa gỗ mít thủ công, phong cách truyền thống.', 8000000.00, 25, 1, 4.00, '40x20x20', 'Gỗ mít', 'Việt Nam', 24, 'in_stock', '2025-01-01 18:04:20', '2025-01-01 18:04:20'),
(160, 'Bình Gỗ Cẩm Hoa', 'Bình gỗ cẩm hoa có vân gỗ đẹp tự nhiên, được chạm khắc tinh tế, mang đến vẻ sang trọng và đẳng cấp.', 'Bình gỗ cẩm hoa, vân gỗ tự nhiên, tinh xảo.', 10000000.00, 20, 1, 6.00, '45x25x25', 'Gỗ cẩm hoa', 'Việt Nam', 24, 'in_stock', '2025-01-01 18:04:21', '2025-01-01 18:04:21'),
(161, 'Đèn Thác Trầm Sen Trắng', 'Đèn thác trầm thiết kế hình hoa sen trắng, mang đến vẻ đẹp thanh tao và hương thơm thư giãn từ trầm hương, phù hợp trang trí và sử dụng trong thiền định.', 'Đèn thác trầm hoa sen trắng, thanh tịnh và thư giãn.', 6000000.00, 30, 1, 3.00, '35x20x20', 'Gỗ và gốm sứ', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:22', '2025-01-01 18:04:22'),
(162, 'Bộ Ấm Bầu 8 Món Men Xanh Biển Hổ', 'Bộ ấm trà 8 món được chế tác từ gốm sứ cao cấp với lớp men xanh biển óng ánh, tạo nên vẻ đẹp thanh lịch và sang trọng. Thiết kế tinh xảo, từng đường nét đều được thực hiện thủ công, mang đậm phong cách truyền thống Việt Nam. Bộ sản phẩm gồm 1 ấm trà, 6 chén trà, và 1 đĩa lót, rất phù hợp để pha trà trong những dịp đặc biệt hoặc làm vật trang trí nổi bật cho không gian sống. Đây là món quà ý nghĩa dành tặng gia đình, bạn bè, hoặc đối tác.', 'Bộ ấm trà 8 món men xanh biển, phong cách truyền thống.', 690000.00, 44, 2, 2.00, 'D15xH15', 'Gốm sứ', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:23', '2025-01-07 06:29:50'),
(163, 'Lọ Hoa Gốm Vân Sọc Xanh Độc Đáo', 'Lọ hoa gốm vân sọc xanh độc đáo được chế tác từ gốm sứ cao cấp với cảm hứng từ nghệ thuật Shibori truyền thống Nhật Bản. Thiết kế độc đáo với các họa tiết vân sọc được tạo thủ công, mỗi sản phẩm mang đậm dấu ấn nghệ thuật riêng biệt. Với vẻ đẹp tinh tế và phong cách trừu tượng, lọ hoa không chỉ phù hợp để cắm hoa mà còn là điểm nhấn trang trí nổi bật trong mọi không gian, từ phòng khách, phòng làm việc đến quà tặng cho những dịp đặc biệt.', 'Lọ hoa gốm nghệ thuật vân sọc xanh, phong cách Shibori.', 890000.00, 28, 2, 3.00, 'D15xH30', 'Gốm sứ', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:24', '2025-01-05 16:59:08'),
(164, 'Đèn Fairy 3', 'Đèn Fairy 3 là sản phẩm thủ công tinh xảo, kết hợp giữa nghệ thuật chế tác gốm truyền thống và công nghệ hiện đại. Phần đế đèn làm từ gốm nung chất lượng cao, với hoa văn tinh tế, tạo nên sự hài hòa giữa ánh sáng và vật liệu. Ánh sáng từ đèn mang lại cảm giác ấm áp và thư giãn, phù hợp để trang trí phòng ngủ, phòng khách hoặc làm quà tặng độc đáo trong các dịp lễ. Sản phẩm mang đến không gian sống thanh lịch và phong cách.', 'Đèn gốm thủ công, ánh sáng ấm áp và tinh tế.', 1200000.00, 30, 2, 1.50, 'H25xD15', 'Gốm và đèn LED', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:25', '2025-01-06 12:31:40'),
(165, 'Ấm Chén Tử Sa Màu Son Đắp Tùng', 'Bộ ấm chén tử sa màu son là sản phẩm thủ công cao cấp, được làm từ đất tử sa nguyên chất, một chất liệu đặc biệt nổi tiếng với khả năng giữ nhiệt và bảo quản hương vị trà. Bộ sản phẩm được trang trí bằng các họa tiết đắp nổi hình cây tùng, tượng trưng cho sức sống mãnh liệt và sự trường thọ. Đây là lựa chọn hoàn hảo cho những người yêu trà, vừa để thưởng trà, vừa là vật trang trí mang giá trị phong thủy và nghệ thuật.', 'Bộ ấm chén tử sa, họa tiết cây tùng đắp nổi, cổ điển.', 850000.00, 25, 2, 2.00, 'D12xH10 (ấm), D6xH5 (chén)', 'Đất tử sa', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:26', '2025-01-01 18:04:26'),
(166, 'CHETIT - Bình Hoa', 'Bình hoa CHETIT được chế tác thủ công từ gốm đất nung trắng với lớp men trơn mịn và sắc trắng hoặc xanh chàm tinh tế. Sản phẩm được tạo ra từ làng nghề gốm Tân Vạn, nơi có lịch sử hơn 300 năm, nổi tiếng với tay nghề điêu luyện. Với thiết kế tối giản nhưng không kém phần tinh tế, bình hoa phù hợp để cắm hoa, trang trí không gian nội thất hiện đại hoặc làm quà tặng ý nghĩa trong các dịp đặc biệt.', 'Bình hoa gốm đất nung thủ công, phong cách truyền thống.', 890000.00, 20, 2, 1.80, 'D15xH30', 'Gốm đất nung', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:27', '2025-01-01 18:04:27'),
(167, 'Lọ Hoa Gốm Bát Tràng', 'Lọ hoa gốm Bát Tràng là sản phẩm kết tinh từ bàn tay khéo léo của các nghệ nhân làng gốm nổi tiếng Bát Tràng. Được làm từ gốm sứ cao cấp, sản phẩm có lớp men bóng mượt và thiết kế mềm mại, phù hợp với nhiều phong cách trang trí nội thất khác nhau. Lọ hoa vừa có thể dùng để cắm hoa tươi, hoa khô, vừa là món đồ trang trí tuyệt vời mang lại nét đẹp truyền thống và hiện đại cho không gian sống.', 'Lọ hoa gốm Bát Tràng, thiết kế tinh tế, sang trọng.', 750000.00, 34, 2, 2.00, 'D20xH25', 'Gốm sứ', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:28', '2025-01-05 07:11:37'),
(169, 'Đèn Lồng Quạt', 'Đèn lồng quạt được làm thủ công từ vật liệu tự nhiên, mang phong cách truyền thống nhưng không kém phần hiện đại. Thiết kế độc đáo, dễ dàng gấp gọn, thích hợp để trang trí không gian nội thất hoặc các sự kiện. Sản phẩm mang đậm nét đẹp của làng nghề thủ công Việt Nam, với sự tinh tế trong từng chi tiết.', 'Đèn lồng quạt thủ công, phong cách truyền thống.', 350000.00, 96, 3, 0.30, 'D40xH60', 'Tre', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:30', '2025-01-06 12:33:12'),
(170, 'Rổ Vuông Viền Có Chân', 'Rổ vuông viền có chân được làm từ tre tự nhiên, mang phong cách mộc mạc và tinh tế. Sản phẩm có thiết kế tiện lợi với chân đỡ chắc chắn, thích hợp để sử dụng trong gia đình, làm đồ đựng hoặc trang trí không gian sống.', 'Rổ vuông có chân từ tre, mộc mạc và tiện lợi.', 102000.00, 146, 3, 0.50, 'D25xH15', 'Tre', 'Việt Nam', 6, 'in_stock', '2025-01-01 18:04:31', '2025-01-06 12:17:40'),
(171, 'Rổ Xuồng Lôn Mốt', 'Rổ xuồng lôn mốt là sản phẩm thủ công mỹ nghệ, được làm từ tre đan với các họa tiết truyền thống. Thiết kế gọn nhẹ, tiện lợi, phù hợp để sử dụng trong gia đình hoặc làm vật trang trí mang phong cách cổ điển.', 'Rổ xuồng tre đan, họa tiết truyền thống.', 85500.00, 199, 3, 0.40, 'D30xH10', 'Tre', 'Việt Nam', 6, 'in_stock', '2025-01-01 18:04:32', '2025-01-06 11:47:18'),
(172, 'Rổ Xuyên Hoa', 'Rổ xuyên hoa được chế tác từ tre tự nhiên với các họa tiết hoa đan tay tinh xảo, mang lại vẻ đẹp nghệ thuật và gần gũi với thiên nhiên. Sản phẩm thích hợp để đựng đồ hoặc làm vật trang trí mang phong cách dân dã.', 'Rổ tre xuyên hoa, họa tiết thủ công tinh xảo.', 90000.00, 179, 3, 0.40, 'D25xH12', 'Tre', 'Việt Nam', 6, 'in_stock', '2025-01-01 18:04:33', '2025-01-06 11:34:41'),
(173, 'Khay Trà', 'Khay trà được làm từ tre tự nhiên, thiết kế tối giản nhưng đầy tinh tế, phù hợp để sử dụng trong các buổi trà đạo hoặc trang trí không gian nội thất. Sản phẩm mang lại vẻ đẹp truyền thống và cảm giác gần gũi với thiên nhiên.', 'Khay trà tre tự nhiên, thiết kế tối giản.', 150000.00, 99, 3, 0.70, 'D35xH5', 'Tre', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:34', '2025-01-07 06:47:24'),
(174, 'Khuyên Tai Tua Rua', 'Khuyên tai tua rua handmade với thiết kế tinh tế, độc đáo, phù hợp cho các phong cách thời trang hiện đại. Sản phẩm mang lại nét đẹp thanh lịch và năng động, dễ dàng phối hợp với nhiều loại trang phục.', 'Khuyên tai tua rua handmade, thanh lịch và độc đáo.', 150000.00, 49, 4, 0.05, 'D4xH10', 'Vải', 'Việt Nam', 6, 'in_stock', '2025-01-01 18:04:35', '2025-01-06 11:22:31'),
(175, 'Bộ Trang Sức Handmade Ngọc Trai Gold', 'Bộ trang sức 3 món gồm vòng cổ, vòng tay và khuyên tai, được chế tác từ ngọc trai cao cấp kết hợp với chất liệu Gold Filled bọc vàng. Thiết kế tinh xảo, vừa mang vẻ đẹp cổ điển, vừa hiện đại, tôn lên nét sang trọng của phụ nữ Á Đông. Sản phẩm phản xạ ánh sáng lung linh, bền đẹp theo thời gian và rất dễ phối đồ.', 'Bộ trang sức ngọc trai Gold Filled, thiết kế tinh xảo.', 3400000.00, 27, 4, 0.20, NULL, 'Ngọc trai, đá quý, bạc, vàng.', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:36', '2025-01-05 10:48:35'),
(176, 'Vòng Tay Chuỗi Hạt Sứ Handmade', 'Vòng tay chuỗi hạt sứ handmade được làm thủ công tỉ mỉ với các hạt sứ màu sắc hài hòa, mang lại phong cách nhẹ nhàng và cổ điển. Phù hợp để sử dụng hàng ngày hoặc làm quà tặng ý nghĩa.', 'Vòng tay chuỗi hạt sứ handmade, phong cách cổ điển.', 8000.00, 199, 4, 0.10, 'D18 (chu vi)', 'Sứ', 'Việt Nam', 6, 'in_stock', '2025-01-01 18:04:37', '2025-01-05 13:48:22'),
(177, 'Dây Khánh – Miếng Ngọc', 'Dây khánh treo xe hơi được chế tác từ ngọc Aventurine xanh, với hình tượng Di Lặc cười mang ý nghĩa phong thủy, giúp thu hút bình an, tài lộc và may mắn. Sản phẩm phù hợp để trang trí trong xe hơi, không gian sống hoặc làm quà tặng tâm linh độc đáo.', 'Dây khánh Di Lặc bằng ngọc Aventurine, mang lại may mắn.', 750000.00, 49, 4, 0.20, 'D6xH12', 'Ngọc Aventurine', 'Việt Nam', 12, 'in_stock', '2025-01-01 18:04:38', '2025-01-05 17:08:42'),
(178, 'Khuyên Tai Lông Vũ', 'Khuyên tai lông vũ với thiết kế nhẹ nhàng, uyển chuyển, phù hợp với các phong cách thời trang boho hoặc thanh lịch. Sản phẩm được làm thủ công với chất liệu lông vũ tự nhiên, tạo cảm giác thoải mái và nổi bật.', 'Khuyên tai lông vũ handmade, nhẹ nhàng và nổi bật.', 100000.00, 50, 4, 0.03, 'D3xH12', 'Lông vũ và hợp kim', 'Việt Nam', 6, 'in_stock', '2025-01-01 18:04:39', '2025-01-01 18:04:39'),
(179, 'Vòng Tay Handmade Gắn Chuông', 'Vòng tay handmade được thiết kế từ các hạt đá tự nhiên và gắn kèm chuông nhỏ, mang lại phong cách trẻ trung, đáng yêu. Sản phẩm phù hợp để làm phụ kiện thời trang hoặc quà tặng cho bạn bè và người thân.', 'Vòng tay handmade gắn chuông, trẻ trung và đáng yêu.', 120000.00, 99, 4, 0.10, 'D18 (chu vi)', 'Đá tự nhiên và hợp kim', 'Việt Nam', 6, 'in_stock', '2025-01-01 18:04:40', '2025-01-07 05:26:02'),
(180, 'Vòng tay handmade', 'Sản phẩm vòng tay điều chỉnh kích thước to nhỏ dễ dàng, dễ thương, làm nổi bật cho các cô gái', 'Vòng đá gỗ kết hợp mặt bạc, kiểu vòng tay handmade', 8000.00, 4, 4, 0.10, 'D18 (chu vi)', 'Đá gỗ kết hợp mặt bạc', 'Việt Nam', 6, 'low_stock', '2025-01-01 18:04:41', '2025-01-06 14:44:18');
